syntax "proto3";

package azurerm;

message AzurermLbNatPool {
  backend_port = 1;
  frontend_ip_configuration_id = 2;
  frontend_ip_configuration_name = 3;
  frontend_port_end = 4;
  frontend_port_start = 5;
  id = 6;
  loadbalancer_id = 7;
  name = 8;
  protocol = 9;
  resource_group_name = 10;
  message Timeouts {
    create = 1;
    delete = 2;
    read = 3;
    update = 4;
  }
  timeouts = 11;
}